    // <PhoneHandler>  = sip provider => insert as prop the func makeCall to chiled

    // we will get the ext and pass by user id in useefect before the provider

    // now test alert for inbound callind

    return (
        <PhoneHandler password={'RjH2TV2s9s8FHSpz'} ext={'200'}>
            <>
                <Dialer />
                <IncommingAlertComp incomingCall={true} />
            </>
        </PhoneHandler>
    );
}

export default Phone;
